import React, { Component } from 'react';

class CreateNote extends Component {
    render() {
        return (
            <div>
                Title: <input type="text" /><br />
                Content: <input type="text" /><br />
                Author: <input type="text" /><br />
                Place: <input type="text" /><br />
            </div>
        );
    }
}

export default CreateNote;
